@esnet120 מבלי להתייחס לדעת ההלכה בעניין, עוד הרבה לפני 20 שבועות זאת חוויה בלתי ניתנת לעיכול, לא כשהיא באופן טבעי וודאי באופן יזום.
זה כאב שלא עוזב. אף פעם.
תזכרי את העובדה שעם כל הכבוד למדע בנוגע להריונות, הם טועים המון ועדיף לכתת רגליים ממומחה אחד לשני אבל ההחלטה סופית רק עפ"י דעת תורה

@hayekamir אז זהו שאינך צריך לעקוף אף אחד...
רק לעקוב אחר הודעות של מרכזי החיסון על עודפים ולהגיע לאחד מהם...
זהו.תכניס את זה חזרה.

@shellfurman @lirishavit אינני יודעת מה מאחד את כולם, לא ערכתי סקר בנושא. לגבי, הבהרתי באופן ברור את עמדתי.
מבחינתי הדיון מסתיים פה.
שבת שלום.

@rothmar אתה לא ציונות דתית.
אבוי אם הציונות הדתית תראה כמוך.
היחידי שמשחית את המדינה זה הנאשם בפלילים המושחת נוכל שקרן מסית

